import React from "react";
import { experience } from "../data";
import { BriefcaseIcon, CodeIcon } from "@heroicons/react/solid";

export default function Experience() {
    return (
        <section id="experience">
            <div className="container px-5 py-10 mx-auto">
                   <div className="flex flex-col w-full mb-20">
                    <BriefcaseIcon className="mx-auto inline-block w-10 mb-4 text-burntorange" />
                    <h1 className="sm:text-4xl text-3xl font-medium title-font mb-4 text-center">
                        Work Experience
                    </h1>
                    <p className="lg:w-2/3 mx-auto leading-relaxed text-base">
                       Here are a few projects that I have implemented. Please contact me if you would like to follow 
                       up and learn more! As always, feedback is always welcomed. 
                    </p>
                </div>
            </div>
        </section>
    )
}
